        SELECT `Athlete`, `Shooting`, `Swimming`, ROW_NUMBER() OVER(PARTITION BY `Athlete` ORDER BY `Shooting` DESC) AS `Shooting_Rank`, ROW_NUMBER() OVER(PARTITION BY `Athlete` ORDER BY `Swimming` ASC) AS `Swimming_Rank`
        FROM (
            SELECT `Athlete`, `Shooting`, `Swimming`
            FROM `table_1_12407546_2`
        )
    )
    WHERE `Shooting_Rank` = 1 AND `Swimming_Rank` = 1
)
GROUP BY `Athlete`;

actual_sql:
