    SELECT col1, col2, col4
    FROM (
        SELECT col1, col2, col4, ROW_NUMBER() OVER(PARTITION BY col1 ORDER BY col2 DESC) AS `Shooting_Rank`, ROW_NUMBER() OVER(PARTITION BY col1 ORDER BY col4 ASC) AS `Swimming_Rank`
        FROM (
            SELECT col1, col2, col4
            FROM `table_1_12407546_2`
        )
    )
    WHERE `Shooting_Rank` = 1 AND `Swimming_Rank` = 1
)
